import './App.css';

function App() {
  return (
    <div className="h-screen flex justify-center items-center bg-blue-500">
      <div className="flex flex-col items-center border border-black bg-blue-600 p-4">
        <div className="max-w-xs mb-4">
          <input type="text" className="w-full p-2" />
        </div>
        <div>
          <button className="px-4 py-2 bg-white">Click me!</button>
        </div>
      </div>
    </div>
);
}

export default App;
